import React from "react";

const RealTimeTracking = () => {
  return (
    <div className="section real-time">
      <h2>Real-Time Appointment Tracking</h2>
      <p>Track your position in the hospital queue, waiting times, and live updates on delays.</p>
      <div className="tracking-info">
        <p><strong>Queue Position:</strong> 3</p>
        <p><strong>Estimated Wait Time:</strong> 15 minutes</p>
        <p><strong>Patients Ahead:</strong> 2</p>
      </div>
    </div>
  );
};

export default RealTimeTracking;
